def prime_factors(numbers):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    integer = numbers[87]
    factors = set()
    for i in range(2, integer + 1):
        if is_prime(i) and integer % i == 0:
            factors.add(i)

    return factors
